import { API_URL } from "utils/const";
import {Axios} from "axios";

export const getPlaces = async () => {
  try {
    const url = `${API_URL}/api/v1/places`;
    const response = await axios.get(url);
    return response;
  } catch (error) {
    return error;
  }
};

export const addPlace = async () => {};
